// src/components/BarLabel.js
import * as React from 'react';
import { BarChart } from '@mui/x-charts/BarChart';

export default function BarLabel() {
  return (
    <BarChart
      xAxis={[{ scaleType: 'band', data: ['group A', 'group B', 'group C'] }]}
      series={[
        {
          data: [4, 3, 5],
          label: ({ dataIndex }) => ` ${[4, 3, 5][dataIndex]}`, // Display value on top of the bar
        },
        {
          data: [1, 6, 3],
          label: ({ dataIndex }) => ` ${[1, 6, 3][dataIndex]}`, // Display value on top of the bar
        },
        {
          data: [2, 5, 6],
          label: ({ dataIndex }) => ` ${[2, 5, 6][dataIndex]}`, // Display value on top of the bar
        },
      ]}
      width={500}
      height={300}
      barLabel="value"
    />
  );
}
